// Input: N
// Output: - A basis for the cusp forms of level N for which all AL involutions act as diagonal matrices
// - the matrices of the AL involutions (listed in ascending order by AL index)

all_diag_basis_AL := function(N, ds);
    C := CuspForms(N);
    g := Dimension(C);

    al_inds := [ m : m in Divisors(N) | GCD(m,N div m) eq 1 and m gt 1];
    al_invols := [AtkinLehnerOperator(C,d) : d in al_inds];

    T, new_als := simul_diag(al_invols);
    B := Basis(C);
    cleardenom := LCM([Denominator(x) : x in Eltseq(T)]);
    NB := [&+[cleardenom*T[i,j]*B[j] : j in [1..g]] : i in [1..g]];
    //print NB, new_als;
    // Optional code to swap the basis "blocks" if the level is prime
    //if IsPrime(N) then
    //    diag := [(T*al_invols[1]*T^(-1))[i,i] : i in [1..g]];
    //    ind := Index(diag, -1);
    //    NB := [NB[i] : i in [ind..g]] cat [NB[i] : i in [1..ind-1]];
    //end if;
    function is_invariant(i, d)
        return new_als[Index(al_inds, d)][i,i] eq +1;
    end function;
    invariant_indices := [i : i -> f in NB | forall{d : d in ds | is_invariant(i, d)}];
    assert #invariant_indices eq genus_quo(N, ds);
    NBwd := NB[invariant_indices];
    return NBwd;
end function;


function AddInGroup(N, x,y,E, minus_eigenvals)
    K<q> := Parent(x);
    N_over_M := ExactQuotient(N, Conductor(E));
    printf "N/M = %o\n", N_over_M;
    Eq := BaseChange(E, Parent(x));
    Pinvariant := Eq![x,y];

    for d in [d : d in Divisors(N_over_M) | d ne 1 and Gcd(d, ExactQuotient(N_over_M,d)) eq 1] do
        Pd := Eq![Evaluate(x, q^d), Evaluate(y, q^d)];
        plus_sign  := &and[GCD(d,p) eq 1 : p in minus_eigenvals];
        if plus_sign then 
            Pinvariant +:= Pd;
        else 
            Pinvariant -:= Pd;
        end if;

    end for;

    assert Pinvariant[3] eq 1;
    x := Pinvariant[1];
    y := Pinvariant[2];
    return x, y;
end function;

function solve_x_in_canonical_ring(N, forms, xs)
    //solve for the sequence of things in x in the canonical ring as a rational function of forms
    d1 := 2;
    indexGam:=N*&*[Rationals() | 1+1/p : p in PrimeDivisors(N)];
    g := #forms;
    R<[a]> := PolynomialRing(Rationals(),g);

    done := false;
    while not done do
        printf "trying d1 = %o ...\n", d1;
        prec := Ceiling(indexGam* 2*d1/12);
        expanded_forms := [qExpansion(f, prec) : f in forms]; //all eigenforms
        monomials := MonomialsOfDegree(R,d1); //monomials of degree 2
        evals := [Evaluate(mon, expanded_forms) : mon in monomials]; //evaluate monomials of degree 2 in eigenforms
        evals_x := [];
        for x in xs do
            Append(~evals_x, [f*x : f in evals]); // multiply by x
        end for;
        allevals_x := &cat evals_x;
        prec := Minimum([Degree(f) : f in evals cat allevals_x ]);
        val := Minimum([Valuation(f) : f in evals cat allevals_x]);
        Pxs := [];
        Qxs := [];
        for i->x in xs do
            done := true;
            Mx := Matrix(Rationals(),[[Coefficient(f,i) : i in [val..prec]] : f in evals cat evals_x[i]]);
            if Rank(Mx) ge #monomials*2 then 
                printf "min(%o) >= %o\n", Rank(Mx), #monomials*2;
                d1 +:= 1;
                done := false;
                continue;
            end if;
            vx := ClearDenominator(Kernel(Mx).1)[1];
            Px := &+[monomials[i]*vx[i] : i in [1..#monomials]];
            Qx := &+[monomials[i]*vx[i+#monomials] : i in [1..#monomials]];
            Qx_eval := &+[Evaluate(monomials[i],expanded_forms)*vx[i+#monomials] : i in [1..#monomials]] ;

            if IsWeaklyZero(Qx_eval)  then
                printf "Some Qx = 0.\n";
                d1 +:= 1;
                done := false;
                continue;
            end if;
            Append(~Pxs, Px);
            Append(~Qxs, Qx);
        end for;

    end while;
    return Pxs, Qxs;

end function;


function FindRelationPolys(x,y,E, forms, N, minus_eigenvals)
    // E the rank zero quotient
    // x and y from sage the modular parametrization
    // the x and y are based on the output of the sage code. We could probably
    // get away with less precision
    // need also the atkin lehner eigenvals of f associated to E, for the signs on the formal immersion
    // given as in input of sequence of primes diving M where the eigenvalue is -1
    x, y := AddInGroup(N, x,y,E, minus_eigenvals);

    // we try to find to express the modular parametrerization in terms of our canonical model
    C := canonic(forms);

    Pxs, Qxs := solve_x_in_canonical_ring(N, forms, [x,y]);
    print "Computed map!";
    phi :=  map< C -> E | [-Pxs[1]*Qxs[2],-Pxs[2]*Qxs[1],Qxs[1]*Qxs[2]]>;

    return phi;
end function;
