procedure VerifyRationalPoints(phi)
    E := Codomain(phi);
    MW, mMW := MordellWeilGroup(E);
    assert TorsionFreeRank(MW) eq 0;
    printf "#E(Q) = %o\n", #MW;
    pointsX := {@ @};
    for pt in MW do 
      ptE := mMW(pt);
      ptX := ptE@@phi;
      time pts := RationalPoints(ptX);
      pointsX join:= pts;
      // print pts;
    end for;
    bs := BaseScheme(phi);
    assert Dimension(bs) eq 0 or Dimension(bs) eq -1;
    pts := RationalPoints(bs);
    pointsX join:= pts;
    printf "X(Q) = %o (%o points)\n", pointsX, #pointsX;
end procedure;

